const Navbar = () => {
  return(
    <div className='Nav-bar'>
        <Link to={'/'}>Director</Link>
        <Link to={'/'}>Actor</Link>
        <Link to={'/'}>Title</Link>
        <br></br>
    </div>

  )
}

export default Navbar;
